import Link from 'next/link';
import { useRouter } from 'next/router';
import fetch from 'isomorphic-unfetch';

const About = () => {
    const data = fetch('http://localhost:3000/test').then(data =>  data);
    console.log(data);

    return(
        <div>
            About Page
        </div>
    )
}

export default About;
